import React from "react";
import styled from "styled-components";
import img from "../images/disney-hotstar-logo-dark.svg";
import MenuIcon from "@mui/icons-material/Menu";
const Header = () => {
  return (
    <>
      <MainHeader>
        <NavContainer>
          <LeftMenu>
            <MenuBar>
              <MenuIcon />
            </MenuBar>
            <Logo>
              <img src={img} alt="asa" />
            </Logo>
            <NavLinks>
              <a href="#">TV</a>
              <a href="#">Movies</a>
              <a href="#">Sports</a>
              <a href="#">Disney+</a>
            </NavLinks>
          </LeftMenu>
          <RightMenu></RightMenu>
        </NavContainer>
      </MainHeader>
    </>
  );
};

export default Header;
const MainHeader = styled.div`
  position: fixed;
  margin: 0 auto;
  top: 0;
  left: 0;
  max-width: 100%;
  width: 100%;
  z-index: 999999;
  font-family: "Roboto", "HelveticaNeue-Light", sans-serif;
  background-color: #121926;
`;

const NavContainer = styled.div`
  display: flex;
  width: 100vw;
  flex-direction: row;
  ${"" /* justify-content: space-evenly; */}
  align-items: center;
  padding: 0 50px;
  margin: 0 auto;
  margin-top: 6px;
  min-height: 66px;
`;
const LeftMenu = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-between;
`;
const NavLinks = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-around;

  a {
    text-decoration: none;
    color: #ffffffcc;
  }
`;
const RightMenu = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-around;

  min-height: 72px;
`;
const MenuBar = styled(MenuIcon)`
  color: #ffffff99;
`;
const Logo = styled.div``;
